import './App.css';
import Header from './Header';
import Recommended from './Recommended';
import Sidebar from './Sidebar';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <Router>
      <Switch>
        <Route path='/'>
          <div className="App">
            <Header/>
            <div className='app_page'>
            <Sidebar/>
            <Recommended/>
            </div>
          </div>
      </Route>
      </Switch>
    </Router>
  );
}

export default App;
